import React from "react";
// import "./pages.css"
import Container from "../components/Container";

const Home = () => (
    <div style={{backgroundColor: "black", height: "100vh", width: "100%", position: "fixed"}}>
        <Container style={{marginTop: "5px", color:"white"}}>
            <h1>Homepage</h1>
        </Container>
    </div>
)

export default Home;
